import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
// SuperAdmin
import saLogin from './superadmin/page/Login';
import saDashboard from './superadmin/page/Dashboard';
import saManageDevice from './superadmin/page/ManageDevice';
import saManageUsers from './superadmin/page/ManageUsers';
import saManageUserRole from './superadmin/page/ManageUserRole';
import saManageFinance from './superadmin/page/ManageFinance';
import saManageReseller from './superadmin/page/ManageReseller';
import saProfile from './superadmin/page/Profile';
// ResellerAdmin
import raLogin from './reselleradmin/page/Login';
import raDashboard from './reselleradmin/page/Dashboard';
import raManageClient from './reselleradmin/page/ManageClient';
import raManageDevice from './reselleradmin/page/ManageDevice';
import raManageFinance from './reselleradmin/page/ManageFinance';
import raProfile from './reselleradmin/page/Profile';
// ClientAdmin
import caLogin from './clientadmin/page/Login';
import caDashboard from './clientadmin/page/Dashboard';
import caManageDevice from './clientadmin/page/ManageDevice';
import caManageUsers from './clientadmin/page/ManageUsers';
import caMgManageDevice from './clientadmin/page/MgManageDevice';
import caMgManageUser from './clientadmin/page/MgManageUser';
import caWallet from './clientadmin/page/Wallet';
import caProfile from './clientadmin/page/Profile';
const App = () => {

  // Reseller Admin Authentication State
  const storedResellerAdminUser = JSON.parse(sessionStorage.getItem('resellerAdminUser'));
  const [resellerAdminLoggedIn, setResellerAdminLoggedIn] = useState(!!storedResellerAdminUser);
  const [resellerAdminUserInfo, setResellerAdminUserInfo] = useState(storedResellerAdminUser || {});
  // const [resellerAdminInitialLoad, setResellerAdminInitialLoad] = useState(true);

  const handleResellerAdminLogin = (data) => {
    const { email, ...rest } = data;
    setResellerAdminUserInfo({ email, ...rest });
    setResellerAdminLoggedIn(true);
    sessionStorage.setItem('resellerAdminUser', JSON.stringify({ email, ...rest }));
  };

  const handleResellerAdminLogout = () => {
    setResellerAdminLoggedIn(false);
    setResellerAdminUserInfo({});
    sessionStorage.removeItem('resellerAdminUser');
  };

  return (
    <Router>
      <Routes>
        {/* Super Admin Routes */}
        <Route path="/superadmin" element={<SuperAdminApp />} />

        {/* Reseller Admin Routes */}
        <Route
          path="/"
          element={
            resellerAdminLoggedIn ? (
              <Routes>
                <Route path="/" element={<Navigate to="/radashboard" />} />
                <Route path="/radashboard" element={<raDashboard userInfo={resellerAdminUserInfo} handleLogout={handleResellerAdminLogout} />} />
                <Route path="/ramanagedevice" element={<raManageDevice userInfo={resellerAdminUserInfo} handleLogout={handleResellerAdminLogout} />} />
                <Route path="/raManageClient" element={<raManageClient userInfo={resellerAdminUserInfo} handleLogout={handleResellerAdminLogout} />} />
                <Route path="/raManageFinance" element={<raManageFinance userInfo={resellerAdminUserInfo} handleLogout={handleResellerAdminLogout} />} />
                <Route path="/raprofile" element={<raProfile userInfo={resellerAdminUserInfo} handleLogout={handleResellerAdminLogout} />} />
              </Routes>
            ) : (
              <Route path="/" element={<raLogin handleLogin={handleResellerAdminLogin} />} />
            )
          }
        />

        {/* Client Admin Routes */}
        <Route path="/clientadmin/*" element={<ClientAdminApp />} />
      </Routes>
    </Router>
  );
};

export default App;
